import React from "react";
import { Row, Col, Divider } from 'antd';

export default function BoxContents(props) {
  return (
    <div>
        <Row gutter={{ xs: 8, sm: 16, md: 24, lg: 32 }}></Row>
      <h1>{props.title || "Meu titulo"}</h1>
      <h5>{props.game || "Não Reconhecido"}</h5>
    </div>
  );
}
